import './Skills.scss';

export default function Hobbies(){
    return(
    <div>
    <h1 style={{textAlign:'center'}}><u>Hobbies</u></h1>
    <ul style={{width:'15%', margin:'auto'}}>
    <li>Viajes</li>
    <li>Rugby</li>
    <li>Leer</li>
    <li>Gadget</li>
    <li>Tecnologia</li>
    </ul>
    </div>
    )
}
